import React from "react";
import "./index.css"

class Tableresults extends React.Component {
	render() {
		return(
			<div className="tableresults">
			<h3>This is the Tableresults class</h3>
			  <table className="tableouter">
			    <thead>
				  <tr>
			  		<th>Category</th>
			  		<th>Loudness (db SPL)</th>
			  		<th>Voltage Needed (VRMS)</th>
			  		<th>Power Needed (mW)</th>
				  </tr>
			     </thead>
			    <tbody>
			    <tr>
			      <td>Safe</td>
			      <td>85</td>
			      <td>N/A</td>
			      <td>{this.props.powerresults}</td>
			    </tr>
			    </tbody>
			  </table>
			</div>
		);
	}
}


export default Tableresults;
